import React from "react";
import "./ImageCard.css";

function ImageCard(props) {
  return (
    <div className="card">
      <img src="https://images.pexels.com/photos/2395250/pexels-photo-2395250.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940"></img>   
    </div>
  );
}

export default ImageCard;
